import { AppBar, RaisedButton } from "material-ui";
import { MuiThemeProvider } from "material-ui/styles";
import React, { Component } from "react";

export default class Confirm extends Component {
  continue = (e) => {
    e.preventDefault();
    this.props.nextStep();
  };

  back = (e) => {
    e.preventDefault();
    this.props.prevStep();
  };

  render() {
    const { values, handleChange } = this.props;
    return (
      <MuiThemeProvider>
        <>
          <AppBar title="Enter User Details" />
          <h1>Confirm</h1>
          <div
            style={{
              display: "grid",
              placeItems: "center",
              marginTop: "50px",
            }}
          >

            <br />
            <RaisedButton
              primary={false}
              variant="contained"
              onClick={this.back}
              style={{ margin: 15, width: "250px" }}
            >
              Back
            </RaisedButton>
            <RaisedButton
              primary={true}
              variant="contained"
              onClick={this.continue}
              style={{ margin: 15, width: "250px" }}
            >
              Continue
            </RaisedButton>
          </div>
        </>
      </MuiThemeProvider>
    );
  }
}
